import React from 'react';
import About from './About';
import profilePic from '../imgs/do_vivian.jpeg';

class Home extends React.Component {
    render() {
        return (
            <div>

            <section class="hero">
    <div class="container">
      <div class="row">
        <div class="col-12 col-sm-12 col-md-4 d-md-none shrink">
          <img src="{profilePic}" alt={"Vivian Do"} height="300rem"/>
        </div>
        <div class="col-12 col-sm-12 col-md-8 shrink">
          <h1>VIVIAN DO</h1>
          <h3> FRONT END DEVELOPER/<br></br>GRAPHIC DESIGNER </h3>
          <a class="button" href="#About">Meet Me <i class="fa fa-chevron-down"></i></a>
        </div>
        <div class="col-12 col-sm-12 col-md-4 d-none d-md-block shrink">
          <img src="./imgs/do_vivian.JPG" alt="Vivian Do" height="300rem"/>
        </div>
      </div>
    </div>

  </section>
  </div>
        )
    }
}

export default Home;
